import React from "react";

import "./Carousel.css";

const Carousel = () => {
  return (
    <div>
      <div clasName="slideshow-container">
        <div clasName="mySlides fade">
          <div clasName="numbertext">1 / 3</div>
          <img src="img1.jpg" style="width:100%" />
          <div clasName="text">Caption Text</div>
        </div>

        <a clasName="prev" onclick="plusSlides(-1)">
          &#10094;
        </a>
        <a clasName="next" onclick="plusSlides(1)">
          &#10095;
        </a>
      </div>
      <br />

      <div style="text-align:center">
        <span clasName="dot" onclick="currentSlide(1)"></span>
        <span clasName="dot" onclick="currentSlide(2)"></span>
        <span clasName="dot" onclick="currentSlide(3)"></span>
      </div>
    </div>
  );
};

export default Carousel;
